import styled from 'styled-components';
import {pic} from './logo.svg';

export const Nav = styled.nav`
    background: #000;
    width: 1920px;
    height: 78.7px;
    padding: 13px 258px 5.7px 235.5px;
    object-fit: contain;
    // margin-top: -80px;
    justify-content: center;
    align-items: center;
    font-size: 1rem;
    position: sticky;
    top: 0;
    z-index: 10;

`

export const NavbarContainer = styled.div`
    display: flex;
    justify-content: space-between;
    height: 80px;
    z-index: 1;
    width: 100%;
    padding: 0 24px;
    max-width: 1100px;
`

export const Logo = {
    img: require('./logo.svg')


}

export const NavMenu = styled.ul`
    display: flex;
    align-items: center;
    list-style: none;
    list-style: none;
    text-align: center;
    margin-right: -22px;
`

export const NavItem = styled.li`
    height: 80px;
`
